Value HW_VERSION (\S+)
Value SERIAL_NUMBER (\S+)
Value SYS_MAC (\S+)
Value SOFTWARE_VERSION (\S+)
Value TOTAL_MEMORY (\d+)
Value FREE_MEMORY (\d+)

Start
  ^Arista\s+${MODEL}
